import React from "react";
import "../../App.css";

export default function Resume() {
  return (
    <div class="resume-container">
      <a
        class="resume-link googledocs"
        // to="/"
        href="https://drive.google.com/file/d/16hfKvflIFHEj9ON_IA3REGilk8b2VZYm/view?usp=sharing"
        target="_blank"
        aria-label="Resume"
        rel="noreferrer"
      ></a>
    </div>
  );
}
